import { useEffect, useState } from 'react';
import '../App.css';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';

import { Checkbox } from "primereact/checkbox";
function ReceiptList(){

    const [ticket,setTicket]=useState()



    const paginatorLeft = <Button type="button" icon="pi pi-refresh" text />;
    const paginatorRight = <Button type="button" icon="pi pi-download" text />;

    useEffect(()=>{
    fetch("http://localhost:8080/ticket",{
        method:"GET"
    })
    .then((res=>res.json()))
    .then((data)=>{

        const {content}=data


        setTicket(content)

    })



    },[])
    console.log(ticket)
    return(
        <>

        <div className="card">

        <DataTable value={ticket} paginator rows={5} rowsPerPageOptions={[5, 10, 25, 50]} tableStyle={{ minWidth: '50rem' }}
        paginatorTemplate="RowsPerPageDropdown FirstPageLink PrevPageLink CurrentPageReport NextPageLink LastPageLink"
        currentPageReportTemplate="{first} to {last} of {totalRecords}" paginatorLeft={paginatorLeft} paginatorRight={paginatorRight}>
            <Column field="name" header="Name" style={{ width: '25%' }}></Column>
            <Column field="country.name" header="Country" style={{ width: '25%' }}></Column>
            <Column field="company" header="Company" style={{ width: '25%' }}></Column>
            <Column field="representative.name" header="Representative" style={{ width: '25%' }}></Column>
        </DataTable>
            <DataTable value={ticket} paginator rows={5} tableStyle={{ minWidth: '50rem' }}>
                <Column field="id" header="Code"/>
                <Column field="user.firstName" header="First Name"/>
                <Column field="user.lastName" header=" Name"/>
                <Column field="user.department" header="Departament"/>
                <Column body={(ticket) => <Checkbox checked={ticket.ticketState} />} header="Ticket State"/>

            </DataTable>
        </div>

        </>)

    }
export default ReceiptList;
